// SPDX-License-Identifier: MIT

pragma solidity ^0.5.0;

import "./EllipticCurve.sol";

contract CIDLog {

    event LogEntryNew(
        bytes32 indexed logId,
        address indexed sender,
        address indexed receiver,
        uint256 cid1x,
        uint256 cid1y,
        bytes32 messageHash,
        uint timelock
    );

    event LogVerified(bytes32 indexed logId);

    struct LogContract {
        address sender;
        address receiver;
        uint256 cid1x;
        uint256 cid1y; //the pre-set results calculated by the buyer(sender) for future checking
        uint timelock; // UNIX timestamp seconds - locked UNTIL this time
        bytes32 messageHash; // the hash of the message to be logged
        bool verified; // true if the log was verified
    }

    uint256 public constant GX = 0x79BE667EF9DCBBAC55A06295CE870B07029BFCDB2DCE28D959F2815B16F81798;
    uint256 public constant GY = 0x483ADA7726A3C4655DA4FBFC0E1108A8FD17B448A68554199C47D08FFB10D4B8;
    uint256 public constant AA = 0;
    uint256 public constant PP = 0xFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFEFFFFFC2F;

    modifier futureTimelock(uint _time) {
        // only requirement is the timelock time is after the last blocktime (now).
        // probably want something a bit further in the future then this.
        // but this is still a useful sanity check:
        require(_time > now, "timelock time must be in the future");
        _;
    }


    function haveLog(bytes32 _logId)
        internal
        view
        returns (bool)
    {
        return logs[_logId].sender != address(0);
    }

    modifier logExists(bytes32 _logId) {
        require(haveLog(_logId), "Log does not exist");
        _;
    }

    modifier sklockMatches(bytes32 _logId, uint256 cid2) {
        uint256 cid2x;
        uint256 cid2y;
        (cid2x, cid2y) = EllipticCurve.ecMul(cid2,GX,GY,AA,PP);                  //sk2*G(X,Y) 
        require(logs[_logId].cid1x == cid2x, "CID does not match");
        require(logs[_logId].cid1y == cid2y, "CID does not match");
        _;
    }

    mapping (bytes32 => LogContract) public logs;

    function newLog(address _receiver, uint256 _cid1x, uint256 _cid1y, bytes32 _messageHash, uint _timelock)
        external
        futureTimelock(_timelock)
        returns (bytes32 logId)
    {
        logId = keccak256(
            abi.encodePacked(
                msg.sender,
                _receiver,
                _cid1x,
                _cid1y,
                _messageHash,
                _timelock
            )
        );

        // Reject if a contract already exists with the same parameters. The
        // sender must change one of these parameters to create a new distinct
        // contract.
        if (haveLog(logId))
            revert("Log already exists");

        logs[logId] = LogContract(
            msg.sender,
            _receiver,
            _cid1x,
            _cid1y,
            _timelock,
            _messageHash,
            false
        );

        emit LogEntryNew(
            logId,
            msg.sender,
            _receiver,
            _cid1x,
            _cid1y,
            _messageHash,
            _timelock
        );
    }

    modifier notVerified(bytes32 _logId) {
        require(!logs[_logId].verified, "Already verified");
        _;
    }


     function verifyLog(bytes32 _logId, uint256 _cid2, bytes calldata _message)
         external
         logExists(_logId)
         notVerified(_logId)
         returns (bool)
     {
         LogContract storage log = logs[_logId];
         require(log.receiver == msg.sender, "Only receiver can verify");

         (uint256 cid2x, uint256 cid2y) = EllipticCurve.ecMul(_cid2, GX, GY, AA, PP);
         require(log.cid1x == cid2x && log.cid1y == cid2y, "Invalid sk2 proof");

         require(keccak256(_message) == log.messageHash, "Message hash mismatch");

         log.verified = true;
         emit LogVerified(_logId);
         return true;
     }
}
